import { datatype } from 'faker/locale/zh_TW';



const MessageList= (props) => {
    // console.log(props);
    return (
        <div>
        {props.messageList.map(({text, user}) => (
            <p className= 'comment' key={datatype.uuid()}>{text}<span>{user}</span></p>
        ))}
        </div>
    );
};

export default MessageList;
